import React from 'react';
import firebase from "firebase"

class Profile extends React.Component {



  render() {
    var email, uid;
    firebase.auth().onAuthStateChanged(function(user) {
      if (user) {
        // User is signed in.
         email = user.email;
         uid = user.uid;
      } else {
        // No user is signed in.
      }
    });
    return (
        <h1>{email}</h1>

    )
  }
}


export default Profile;
